# Filter Results Node

## Purpose
Filters and refines data based on specified criteria.

## Configuration
- **Filter Type**: Rule-based, Pattern matching
- **Input Format**: JSON, CSV
- **Output Format**: Filtered dataset

## Filter Options
```javascript
// Sample filter logic
function filterData(input, criteria) {
  return input.filter(item => {
    return criteria.every(rule => 
      applyRule(item, rule)
    );
  });
}
```

## Performance
- Average filter time: 0.8s
- Memory usage: ~20MB
- Filter accuracy: 99.5%
